import { useState } from "react";
import { TextField, Typography, Button } from "@material-ui/core";

export default function Login({ login, setIsLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = () => {
    let loggined = login(username, password);
    if (loggined) {
        console.log("Logged in.")
    }
  };

  return (
    <form>
        <h3>Login</h3>
      <label>
          Username: 
          <input value={username} onChange={(e) => setUsername(e.target.value)} /><br/>
      </label>
      <label>
          Password: 
          <input value={password} type="password" onChange={(e) => setPassword(e.target.value)} /><br/>
      </label>
      <Button variant="contained" color="primary" onClick={() => handleLogin()}>login</Button>{' '}
      <Button variant="contained" color="secondary" onClick={() => setIsLogin(false)}>register</Button>
    </form>
  );
}
